import React from "react";
import "./Bio.css"

const Bio = () => {

    return (
        <div className="bio__wrapper">
            <div className="bio__picture">
                Picture
            </div>
            <div className="bio__content">
                Hi, my name is Jamie Kuesel. 
                I'm a fourth year Computer Science student at Northeastern University with a concentration in Artificial Intelligence. I'm also interested in Computer Vision, Random Noise Generation, and Web Development.
            </div>
        </div>
    )
}

export default Bio;
